        let name = await fetch('https://username-generator-api.glique.repl.co/gen', {
            method: 'GET'
        }).then((res) => res.json);

        // Stupid CORS policy not letting me fetch from here
        // Implement socket and route the fetch through backend server
    }

    //getName();

    return (
        <section id={'nav'}>
            <NavLink to={'/'} id={'logo'}>
                Card Me Daddy
            </NavLink>

            <form className={'change-name'}>
                <input type={'text'} placeholder={ username }/>
                <input type={'submit'} value={'Change Name'}/>
            </form>
        </section>
    );
};

export default Navbar;
